import { useState } from "react";
import { Link, useHistory, useParams } from "react-router-dom";
import { useEffect } from "react/cjs/react.development";
import airlineService from "../services/airline.service";

const RegistrationPage = () => {
    const[email, setEmail] = useState('');
    const[userName, setUserName] = useState('');
    const[phone, setPhone] = useState('');
    const[password, setPassword] = useState('');
    const[confirmPassword, setConfirmPassword] = useState('');
    const[securityQusetion, setSecurityQuestion] = useState('');
    const[answer, setAnswer] = useState('');
    const[userType , setUserType] = useState('');
    const {id} = useParams();



    const saveEmployee = (e) => {
        e.preventDefault();

        const user = {email , userName , phone , password , securityQusetion , answer};

            //create
            airlineService.createUser(user)
            .then(response => {
                console.log("User added successfully", response.data);
              //  history.push("/");
            })
            .catch(error => {
                console.log('something went wroing', error);
            })
    }


    return(
        <div className="container">
            <h3>Register</h3>
            <hr/>
            <form>
            <div className="form-group">
                    <input 
                        type="email" 
                        className="form-control col-4"
                        id="email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        placeholder="ENTER EMAIL"
                        required
                    />

                </div>
                <div className="form-group">
                    <input 
                        type="text" 
                        className="form-control col-4"
                        id="username"
                        value={userName}
                        onChange={(e) => setUserName(e.target.value)}
                        placeholder="ENTER USER NAME"
                        required
                    />

                </div>
                <div className="form-group">
                    <input 
                        type="text" 
                        className="form-control col-4"
                        id="phone"
                        value={phone}
                        onChange={(e) => setPhone(e.target.value)}
                        placeholder="ENTER MOBILE NUMBER"
                        required
                    />

                </div>
                <div className="form-group">
                    <input 
                        type="password" 
                        className="form-control col-4"
                        id="password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        placeholder="ENTER PASSWORD"
                        required
                    />

                </div>
                <div className="form-group">
                    <input 
                        type="password" 
                        className="form-control col-4"
                        id="confirmPassword"
                        value={confirmPassword}
                        onChange={(e) => setConfirmPassword(e.target.value)}
                        placeholder="CONFIRM PASSWORD"
                        required
                    />

                </div>

                {/* <div className='form-group'>
                <input className="form-control col-4" 
                value={securityQusetion} 
                onChange={(e)=>setSecurityQuestion(e.target.value)}
                list="datalistOptions" id="exampleDataList" placeholder="SELECT YOUR SECURITY QUESTION"/>
                            <datalist id="datalistOptions">
                            <option value="What is your school name?"/>
                            <option value="What is your pet name?"/>
                            <option value="Which is your favourite color?"/>
                            <option value="Which is your favourite movie?"/>
                        </datalist>
                </div> */}

                <div>
                <label for="cars">SELECT SECURITY QUESTION:</label>
                <select name="cars" id="cars" value={securityQusetion} 
                onChange={(e)=>setSecurityQuestion(e.target.value)}>
                <option value="What is your school name?">What is your School name?</option>
                <option value="What is your pet name?">What is you pet name? </option>
                <option value="Which is your favourite color?">Which is your favourite color?</option>
                <option value="Which is your favourite movie?">Which is your favourite movie?</option>
                </select>
                </div>

                <div className="form-group">
                    <input 
                        type="text" 
                        className="form-control col-4"
                        id="answer"
                        value={answer}
                        onChange={(e) => setAnswer(e.target.value)}
                        placeholder="ENTER SECURITY ANSWER"
                        required
                    />
                </div>
                {/* 
            <div className='form-group'>
                <input className="form-control col-4" 
                value={userType}
                onChange={(e)=>setUserType(e.target.value)}
                list="userTypes" id="userTypes" placeholder="REGISTERING AS USER/ADMIN"/>
                            <datalist id="userTypes">
                            <option value="ADMIN"/>
                            <option value="USER"/>
                        </datalist>
                </div> */}
                <div>
                <label for="cars">REGISTERING AS ADMIN/USER:</label>
                <select name="cars" id="cars" value={userType} 
                onChange={(e)=>setUserType(e.target.value)}>
                <option value="admin">ADMIN</option>
                <option value="user">USER</option>

                </select>
                </div>

                <div >
                    <button onClick={(e)=>saveEmployee()} className="btn btn-primary">
                        Register</button>
                </div>
            </form>
            <hr/>
        </div>
    )
}

export default RegistrationPage;
